import "./index.css"
import HomePage from "./Component/Home/HomePage";
import { BrowserRouter, Switch, Route } from "react-router-dom";


function App() {
  return (
     <>
        <HomePage />
        <BrowserRouter>
           <Switch>
              <Route exact path="/" component={HomePage} />
           </Switch>
        </BrowserRouter>
     </>
  );
}

export default App;
